Alan's about to head out of the house when he sees pretty little thing Kiki Vidis sitting on his couch. Turns out that Kiki, who is from Australia, is a friend of his sister's and is staying at their pad while she's on holiday in the States. When they get to talkin', Alan learns that women in Australia are much more open sexually than ladies in the homeland, and he gets a taste when he hits on Kiki and the Aussie decides to bounce on his boomerang while his sister is out!
